const binaryString = `











































































































































































































































































































































































































































































































































































































































































































































































































`

function binaryStringToUint8Array(binaryString) {
    const binaryArray = binaryString.split('').map(bit => parseInt(bit));
    return new Uint8Array(binaryArray);
}

// Convert binary string to Uint8Array
const binaryData = binaryStringToUint8Array(binaryString);

// Create a Blob with the binary data (assuming it's a PNG image)
const blob = new Blob([binaryData], { type: 'image/png' });

// Create an object URL from the Blob and display it as an image
const imgElement = document.createElement('img');
imgElement.src = URL.createObjectURL(blob);
document.body.appendChild(imgElement);

